var rotate = 0;
function update( event ) {
	var time = event.time * 0.0001;
	this.position.x = Math.sin( time );
	this.position.z = Math.cos( time );
	//this.position.y = Math.sin( time );

	if(rotate<360){
		this.rotation.z+= .001;
		this.rotation.x+= .001;
		rotate++;
	}else{
		this.rotation.x+= .001;
		this.rotation.z+=.001;
		rotate = 0;
	}

	//this.rotation.x = Math.sin( time );
	//this.rotation.z = Math.sin( time );
	//this.rotation.y = Math.sin( time );
}
